import React, { Component } from 'react';
import { Route, BrowserRouter as Router, Switch } from 'react-router-dom'
import Group from './Group';

class App extends Component {
    state = {}
    render() {
        return (
            <Router>
                <Switch>
                    <Route path='/grupid' exact={true} component={Group} />
                </Switch>
            </Router>
        );
    }
}

export default App;
